import React from 'react';
import Navbar from './Navbar';
import About from './About';
import './App.css'; // Ensure this line is present to import the CSS file for App

function App() {
  return (
    <div className="App">
      <Navbar />
      <header className="App-header">
        <h1>Welcome to Jiffy.ai </h1>
        <p>We are committed to providing the best services to our customers.</p>
      </header>
      <main>
        <About />
        <section className="services">
          <h2>Our Services</h2>
          <p>We offer a wide range of services including...</p>
        </section>
        <section className="contact">
          <h2>Contact Us</h2>
          <p>Feel free to reach out to us at contact@yourcompany.com</p>
        </section>
      </main>
    </div>
  );
}

export default App;
